import { BrowserRouter, Route, Routes } from "react-router-dom";
import "./App.css";
import Slidebar from "./components/Slidebar";
// import  from "bootstrap/js/dist/u";

const App = () => {
  return (
    <div className="App">
      <BrowserRouter>
        <Routes>
          <Route path="/" />
        </Routes>
      </BrowserRouter>
    </div>
  );
};

export default App;
